import React from 'react';
import ReactDOM from 'react-dom';
import Fetchdata from './fetch_data.jsx'
import {useState} from 'react';
import './styles.css';

export default function Searchhandle(){
  const [data,setData]=useState("");
  function event(){
    let ele1=document.querySelector('.input-search');
    setData(()=>{
      data=ele1.value;
    });
  }
    return (
          <div className='handle'>
          <div className='outer'>
          <input type="text" placeholder="codeforces handle" class="search-input"></input>
          <button class="search-button" onClick={event}>Search</button>
      

            </div>
            <Fetchdata data={data}></Fetchdata>
          </div>
          
    );
}
